import React from 'react'
import { connect } from 'react-redux'
import { modifySort, modifySortOrder } from '../../redux/actions/view'
import OrderSelect from './Order';
import Sort from './Sort';

const SortBox = ({ modifySort, modifySortOrder }) => {
  return (
    <div className="card">
      <div className="card-header">
        <p className="card-header-title">Sort</p>
        <OrderSelect />
      </div>
      <div className="card-content">
        <Sort />
      </div>
    </div>
  )
}

export default connect(null, { modifySort, modifySortOrder })(SortBox)
